__NUXT_JSONP__("/jachthaven", (function(a,b,c){return {data:[{story:{name:b,created_at:"2021-03-08T10:52:12.151Z",published_at:"2021-05-04T18:40:08.230Z",alternates:[],id:40661538,uuid:"9f687691-b333-4bdd-a290-c2b4314100a3",content:{_uid:"79405e24-161a-42a0-b7ff-403d0ac81a3e",image:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F1250x703\u002F282f77b83a\u002F14.jpeg",title:"Ontstaan, ontworpen en ontwikkeld in Amsterdam. \nDavy & Ørsted een merk met een Amsterdamse heritage en Scandinavische uitstraling.",content:"**Uniek stek aan het Nieuwe Meer**\nDe werf aan het Boeierspad in Amsterdam is het nautische centrum van Davy & Ørsted waar alles samen komt. Een bijzondere plek tussen het centrum en de bossen van Amsterdam aan het Nieuwe Meer.\n\nDe sloepen van Davy & Ørsted worden met zorg (af)gebouwd in de loods van de werf. Hierdoor hebben we alles tot de kleinste details zelf in handen en mag de klant een perfect afgemonteerd eindproduct van ons verwachten. Van het plaatsen van de motor, het aansluiten van de elektriciteit tot het coaten van de kleinste schroefjes doen wij handmatig op de werk. Ook kan de koper van tijd tot tijd zelf de vorderingen komen bekijken of zelfs zelf meehelpen aan de afbouw.\n\nUiteraard kunt u op de werf ook terecht voor een proefvaart met een van de stoere sloepen van Davy & Ørsted. Wij nemen graag de complete verzorging van uw boot van u over, van onderhoud tot winterstalling.",component:"jachthaven-page",onderhoud:"Onderhoud",image_box_1:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F150x200\u002F4f5fd71ee0\u002Fgrijs.png",image_box_2:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F150x200\u002F34bf093b35\u002Fgrijs.png",image_box_3:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F150x200\u002Fe3f9337405\u002Fgrijs.png",image_box_4:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F150x200\u002F01f65d3cd4\u002Fgrijs.png",bottom_image:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F1182x665\u002Fe3443b8514\u002F17a.jpeg",header_image:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F1250x703\u002F1b902687b2\u002F14.jpeg",parking_image:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F1182x665\u002F1570e2df23\u002F17a.jpeg",winterstalling:c,onderhoud_image:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F799x600\u002F00bb74b62c\u002F15a.jpeg",parking_content:"**Flex Parking**\nWanneer het gaat om het stallen van uw boot kunt u zelf kiezen wat u belangrijk vindt. Wilt u dat uw boot alleen uit het water is en op de kade staat of kiest u voor een (verwarmde) overdekte stalling. Heeft uw boot een onderhoudsbeurt, extra grondige reiniging of een nieuwe coating nodig? Met Flex Parking heeft u zelf de regie in handen. \n\n**Valet Parking**\nValet parking voor uw boot, hoe klikt dat? \nU levert de sleutels van uw boot bij ons in en heeft er het gehele winterseizoen geen omkijken meer naar, wij verzorgen alles!  Wij zorgen dat uw boot na een onderhoudsbeurt en een goede schoonmaakbeurt netjes en veilig uit het water wordt gehaald en in de verwarmde loods wordt gestald. Zo weet u zeker dat u het volgende seizoen zonder problemen direct weer kan genieten van de boot. In samenspraak plannen we wanneer de boot weer ready to go is en op de afgesproken datum ligt uw boot weer vaarklaar op u te wachten. \n\n**Meer Informatie**\nUiteraard stallen wij niet alleen Davy & Ørsted sloepen. Bent u op zoek naar een veilige en goed verzorgde winterstalling voor uw boot of heeft uw boot een onderhoudsbeurt nodig, neem dan contact met ons op.\n",image_box_1_title:"Nieuws",image_box_2_title:c,image_box_3_title:"Occasions",image_box_4_title:"De werf",onderhoud_content:"\n## Onderhoud\n\n**Wij ontzorgen met zorg**\nAlle kennis voor het bouwen van een boot is bij ons op de werf aanwezig. Onze gekwalificeerde vakmensen hebben niet alleen verstand van een Davy & Ørsted zij draaien hun handen voor geen enkel technisch probleem om. Of het nu gaat om een jaarlijkse onderhoudsbeurt of een meer gecompliceerd mankement bij ons op de werf helpen wij u graag weer snel vaarklaar het water op te krijgen. \n\n**Van Diesel naar Hybride**\nOok het ombouwen van een Diesel naar Hybride motor kunnen wij voor u regelen. Sinds 2018 bereiden wij alle Davy & Ørsted boten met dieselmotoren voor om op den duur over te kunnen gaan naar hybride of zelfs volledig elektrisch. In 2025 mag in de grachten van Amsterdam alleen nog maar elektrisch gevaren worden, dus het voorbereiden op ombouwen is zeker geen overbodige luxe. \n\nNiet alle boten zijn dusdanig ingericht op het ombouwen, dat dit een makkelijke klus is. Mocht u willen weten of uw boot hiervoor in aanmerking komt, neem dan contact met ons op. Wij informeren u hier graag over.\n\n**Re-fit behandeling**\nWilt u dat uw boot er weer als nieuw uitziet dan kunnen wij de boot een volledige re-fit geven. Hoewel een D&O onderhoudsvrij is en jaren meegaat merken we dat D\u002FO eigenaren zuinig zijn op hun mooie boot en hem graag als nieuw willen laten stralen. Het volledig nakijken van alle naden en opnieuw spuiten behoren tot de onderdelen van de Re-fit behandeling. \n",jachthaven_content:"Unieke stek aan het Nieuwe \nMeer De werf aan het Boeierspad in Amsterdam is het nautische centrum van Davy & Ørsted waar alles samen komt. Een bijzondere plek tussen het centrum en de bossen van Amsterdam aan het Nieuwe Meer.\n\nDe sloepen van Davy & Ørsted worden met zorg (af)gebouwd in de loods van de werf. Hierdoor hebben we alles tot de kleinste details zelf in handen en mag de klant een perfect afgemonteerd eindproduct van ons verwachten. Van het plaatsen van de motor, het aansluiten van de elektriciteit tot het coaten van de kleinste schroefjes doen wij handmatig op de werk. Ook kan de koper van tijd tot tijd zelf de vorderingen komen bekijken of zelfs zelf meehelpen aan de afbouw.\n\nUiteraard kunt u op de werf ook terecht voor een proefvaart met een van de stoere sloepen van Davy & Ørsted. Wij nemen graag de complete verzorging van uw boot van u over, van onderhoud tot winterstalling.",winterstalling_image:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F1024x768\u002F3526bbf627\u002F16.jpeg",winterstalling_content:"\n## Winterstalling\n\n**Wat te doen in de winter?**\nNatuurlijk kan de oerdegelijke Davy & Ørsted sloep overwinteren in het water. Een beetje vorst kan deze degelijke sloep zeker aan. Zorg ervoor dat het water is afgetapt, dat er voldoende antivries in alle leidingen en de motor zit, de boot volledig leeg is en de kussen eruit zijn, dan kan de sloep blijven liggen. \n\n**Ons advies**\nBeter is het echter om uw Davy & Ørsted overdekt te leggen of nog beter op de kant te stallen en het liefst in een verwarmde loods. Uit ervaring weten wij dat er eigenlijk niemand gedurende de winter een kijkje neemt bij zijn of haar boot wanneer het een keer hard gestormd heeft of als er een pak sneeuw is gevallen. Ons advies is dan ook altijd: Op de kant of in de loods en het liefst een verwarmde loods. \n"},slug:b,full_slug:"jachthaven\u002F",default_full_slug:a,sort_by_date:a,position:-10,tag_list:[],is_startpage:true,parent_id:39461385,meta_data:a,group_id:"81e9caed-20b6-4d4f-b62d-84cc6ce4b496",first_published_at:"2021-03-17T14:33:32.000Z",release_id:a,lang:"default",path:a,translated_slugs:[]}}],fetch:{},mutations:[]}}(null,"jachthaven","Winterstalling")));